import Header from "./components/Header";
import Footer from "./components/Footer";
import React from "react";
class App extends React.Component {
  constructor(props) {
    super(props);
    this.state = {
      items: [
        {
          id: 1,
          title: "Стул чёрный",
          img: "./img.chair.jpeg",
          desc: "Loren ispum",
          category: "chairs",
          price: "49.99",
        },
        {
          id: 2,
          title: "Стол",
          img: "",
          desc: "Loren ispum",
          category: "tables",
          price: "149.99",
        },
        {
          id: 3,
          title: "Телевизор",
          img: "",
          desc: "Loren ispum",
          category: "tv",
          price: "69.99",
        },
      ],
    };
  }
  render() {
    return (
      <div className="wrapper">
        <Header />
        <Footer />
      </div>
    );
  }
}

export default App;
